import React, { useContext, useEffect } from 'react'
import { storetoken } from './App';


const Logout = () => {
    const {logout}=useContext(storetoken)

    useEffect(() => {
        logout();
      }, [logout]);

  return (
    <>
      <h1>Logout page</h1>
    </>
  )
}

export default Logout
